import React from 'react';
const Person = () => {
  return(
      <div className='center' padding="150px" margin="50px">
      <h4 className='container center'>Person Information</h4>
      <br/ >
      <h6>Name:</h6><input type="text" />
      <h6>Birth Date:</h6><input type="text"/>
      <h6>About Me:</h6><input type="text"/>
      <input type="submit"/>
      </div>
  )
}
export default Person;
